import React, { useMemo, useState, useRef } from 'react';

const COLORS = {
  G93: '#34c759',
  G95: '#007bff',
  G97: '#a259c1',
  Diesel: '#fd7e14',
  Kero: '#6c757d'
};

const FUEL_OPTIONS = [
  { key: 'G93', field: 'g93', label: 'G93' },
  { key: 'G95', field: 'g95', label: 'G95' },
  { key: 'G97', field: 'g97', label: 'G97' },
  { key: 'Diesel', field: 'diesel', label: 'Diesel' },
  { key: 'Kero', field: 'kero', label: 'Kero' }
];

const toNum = (v) => (v === '-' || v == null ? null : Number(v));
const fmtLabel = (dateStr) => {
  // Intenta DD-MM desde entrada “YYYY-MM-DD” o “DD-MM-YYYY”
  if (!dateStr) return '';
  const token = String(dateStr).split(' ')[0];
  const parts = token.split('-');
  if (parts.length === 3) {
    // Detecta formato: si el primer token tiene 4 dígitos => YYYY-MM-DD
    if (/^\d{4}$/.test(parts[0])) {
      const [, m, d] = parts;
      return `${d.padStart(2,'0')}-${m.padStart(2,'0')}`;
    }
    // Si es DD-MM-YYYY
    const [d, m] = parts;
    return `${String(d).padStart(2,'0')}-${String(m).padStart(2,'0')}`;
  }
  return token;
};

export default function TrendChart({ dataRows = [], maxPoints = 7, height = 170 }) {
  const [fuelKey, setFuelKey] = useState('G93');
  const svgRef = useRef(null);

  const { labels, seriesByFuel } = useMemo(() => {
    const sorted = [...dataRows]
      .sort((a, b) => {
        // Orden seguro: intenta parsear YYYY-MM-DD primero
        const aTok = (a.fecha || '').split(' ')[0];
        const bTok = (b.fecha || '').split(' ')[0];
        const aD = aTok && /^\d{4}-\d{2}-\d{2}$/.test(aTok) ? new Date(aTok) : new Date(a.fecha || 0);
        const bD = bTok && /^\d{4}-\d{2}-\d{2}$/.test(bTok) ? new Date(bTok) : new Date(b.fecha || 0);
        return aD - bD;
      })
      .slice(-maxPoints);

    const labels = sorted.map(r => fmtLabel(r.fecha));
    const seriesByFuel = {
      G93: sorted.map(r => toNum(r.g93)),
      G95: sorted.map(r => toNum(r.g95)),
      G97: sorted.map(r => toNum(r.g97)),
      Diesel: sorted.map(r => toNum(r.diesel)),
      Kero: sorted.map(r => toNum(r.kero))
    };
    return { labels, seriesByFuel };
  }, [dataRows, maxPoints]);

  // Serie activa
  const values = seriesByFuel[fuelKey] || [];
  const present = values.filter(v => v != null);
  const aMin = present.length ? Math.min(...present) : 0;
  const aMax = present.length ? Math.max(...present) : 1;
  const yMin = aMin;
  const yMax = aMax === aMin ? aMin + 1 : aMax;

  // Layout
  const width = 320;
  const margin = { top: 6, right: 8, bottom: 28, left: 46 };
  const innerW = width - margin.left - margin.right;
  const innerH = height - margin.top - margin.bottom;

  const xPos = (i) => {
    if (labels.length <= 1) return margin.left + innerW / 2;
    return margin.left + (i * innerW) / (labels.length - 1);
  };
  const yPos = (v) => {
    if (v == null) return null;
    const span = Math.max(1, (yMax - yMin));
    const y = (v - yMin) / span;
    return margin.top + innerH - y * innerH;
  };

  // Barras compactas
  const colWidth = labels.length > 1 ? Math.max(10, Math.min(24, innerW / (labels.length * 1.4))) : 16;

  // Ticks Y
  const gridY = 3;
  const yTicks = Array.from({ length: gridY + 1 }, (_, k) => yMin + (k * (yMax - yMin)) / Math.max(1, gridY));

  // Tooltip simple sin libs
  const onMouseMove = (e) => {
    const svg = svgRef.current;
    if (!svg) return;
    const pt = svg.createSVGPoint();
    pt.x = e.clientX;
    pt.y = e.clientY;
    const screenCTM = svg.getScreenCTM();
    if (!screenCTM) return;
    const p = pt.matrixTransform(screenCTM.inverse());

    // Encontrar la barra más cercana por X
    let nearest = { idx: -1, dist: Infinity };
    labels.forEach((_, i) => {
      const xC = xPos(i);
      const d = Math.abs(p.x - xC);
      if (d < nearest.dist) nearest = { idx: i, dist: d };
    });

    const idx = nearest.idx;
    const value = values[idx];
    const xC = xPos(idx);
    const y = yPos(value ?? yMin);

    const tip = document.getElementById('trend-tip');
    if (!tip) return;

    if (idx >= 0 && value != null) {
      tip.style.display = 'block';
      tip.style.left = `${e.clientX + 8}px`;
      tip.style.top = `${e.clientY - 18}px`;
      tip.textContent = `${value.toLocaleString('es-CL')}`;
      // Highlight opcional
      const hl = document.getElementById('trend-hl');
      if (hl && y != null) {
        hl.setAttribute('x1', xC);
        hl.setAttribute('x2', xC);
        hl.setAttribute('y1', margin.top);
        hl.setAttribute('y2', margin.top + innerH);
        hl.style.display = 'block';
      }
    } else {
      tip.style.display = 'none';
      const hl = document.getElementById('trend-hl');
      if (hl) hl.style.display = 'none';
    }
  };

  const onMouseLeave = () => {
    const tip = document.getElementById('trend-tip');
    if (tip) tip.style.display = 'none';
    const hl = document.getElementById('trend-hl');
    if (hl) hl.style.display = 'none';
  };

  return (
    <div style={{ minWidth: 320, height, position: 'relative' }}>
      {/* Tooltip absoluto */}
      <div
        id="trend-tip"
        style={{
          position: 'fixed',
          zIndex: 9999,
          display: 'none',
          background: 'rgba(0,0,0,0.75)',
          color: '#fff',
          padding: '2px 6px',
          borderRadius: 4,
          fontSize: 11,
          pointerEvents: 'none'
        }}
      />

      {/* Header con filtro */}
      <div style={{ display: 'flex', alignItems: 'center', gap: 8, marginBottom: 4, paddingLeft: 6 }}>
        <div style={{ width: 8, height: 8, background: COLORS[fuelKey], borderRadius: 2 }} />
        <span style={{ fontSize: 11, color: '#333' }}>Combustible:</span>
        <select
          value={fuelKey}
          onChange={(e) => setFuelKey(e.target.value)}
          style={{ fontSize: 11, padding: '2px 6px', borderRadius: 4, border: '1px solid #d0d0d0', outline: 'none', background: '#fff' }}
        >
          {FUEL_OPTIONS.map(f => (
            <option key={f.key} value={f.key}>{f.label}</option>
          ))}
        </select>
      </div>

      <svg ref={svgRef} width={width} height={height} onMouseMove={onMouseMove} onMouseLeave={onMouseLeave}>
        {/* Línea vertical highlight para cursor */}
        <line id="trend-hl" x1="0" y1="0" x2="0" y2="0" stroke="rgba(0,0,0,0.08)" strokeWidth="1" style={{ display: 'none' }} />

        {/* Grid Y */}
        {yTicks.map((t, idx) => {
          const y = yPos(t);
          return (
            <g key={idx}>
              <line x1={margin.left} x2={margin.left + innerW} y1={y} y2={y} stroke="rgba(0,0,0,0.08)" />
              <text x={margin.left - 6} y={y} textAnchor="end" dominantBaseline="middle" fontSize="10">
                {Math.round(t).toLocaleString('es-CL')}
              </text>
            </g>
          );
        })}

        {/* Etiquetas X DD-MM */}
        {labels.map((lab, i) => (
          <text key={i} x={xPos(i)} y={height - 6} textAnchor="middle" fontSize="10">{lab}</text>
        ))}

        {/* Barras de la serie activa */}
        {values.map((v, i) => {
          const y = yPos(v);
          if (y == null) return null;
          const xCenter = xPos(i);
          const x = xCenter - colWidth / 2;
          const barH = margin.top + innerH - y;
          return (
            <rect
              key={i}
              x={x}
              y={y}
              width={colWidth}
              height={barH}
              fill={COLORS[fuelKey]}
              rx="2"
            />
          );
        })}
      </svg>
    </div>
  );
}
